    stories = JSON.parse(jsonMatch[0]);
  } else {
    stories = JSON.parse(content);
  }
} catch (e) {
  return [{ json: { error: 'Failed to parse', raw: content.substring(0, 500) } }];
}

const timestamp = new Date().toISOString();
return stories.map((story, index) => ({
  json: {
    id: `story_${Date.now()}_${index}`,
    title: story.title || 'Untitled',
    summary: story.summary || '',
    characters: Array.isArray(story.characters) ? story.characters.join(', ') : (story.characters || ''),
    moral: story.moral || '',
    origin: story.origin_country || story.origin || '',
    difficulty: story.difficulty || 'easy',
    status: 'pending',
    created_at: timestamp
