  text = response.candidates[0].content.parts[0].text;
} catch (e) {
  return [{ json: { error: 'No response from Gemini', raw: JSON.stringify(response).substring(0, 300) } }];
}

let script;
try {
  const jsonMatch = text.match(/```json\s*([\s\S]*?)```/) || text.match(/```\s*([\s\S]*?)```/);
  if (jsonMatch) {
    script = JSON.parse(jsonMatch[1]);
  } else {
    const objectMatch = text.match(/\{[\s\S]*\}/);
    script = JSON.parse(objectMatch[0]);
  }
} catch (e) {
  return [{ json: { error: 'Failed to parse script', raw: text.substring(0, 500) } }];
}

